import React from 'react';

const homePage = () => {
  return (
    <div className="bg-white border-gray-200 px-2 ">
      <div className="container flex  mx-auto sm:my-24">
        <div className="mt-10 mx-auto sm:mt-12 sm:px-6 md:mt-16 lg:mt-20 lg:px-8 h-full">
          <div className="flex flex-col md:flex-row w-full items-start justify-between md:justify-start h-full md:h-1/2">
            <div className="text-left z-20 md:z-30 w-full md:w-1/2 flex flex-col items-center md:items-start justify-start md:justify-center h-full">
              <h1 className="tracking-tight font-extrabold text-gray-900 titleHome text-6x1">
                Tail-kit
              </h1>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default homePage;
